import { useDispatch, useSelector } from "react-redux"
import { Addprod, GetAll } from "./actios/acionprodact";
import { useEffect } from "react";

export default function Prodact(){
const prodact1=useSelector(state=>state.prodact);
const dispatch=useDispatch()
useEffect(()=>{
dispatch(GetAll())
},[])
return(
<div>
<button onClick={()=>dispatch(Addprod({id:1,title:"Asas"}))}>Add Pordact</button>
{prodact1.map((prodact)=>(
    <p key={prodact.id}>{prodact.title}</p>))}


</div>
    )
}
